// src/services/searchService.ts
interface SearchResult {
    id: number;
    title: string;
    description: string;
  }
  
  export const search = async (query: string): Promise<SearchResult[]> => {
    // Simular una llamada a una API para obtener resultados de búsqueda
    return new Promise((resolve) => {
      setTimeout(() => {
        resolve([
          { id: 1, title: `Resultado para ${query} 1`, description: `Descripción del resultado 1 para ${query}` },
          { id: 2, title: `Resultado para ${query} 2`, description: `Descripción del resultado 2 para ${query}` },
          { id: 3, title: `Resultado para ${query} 3`, description: `Descripción del resultado 3 para ${query}` },
        ]);
      }, 500);
    });
  };
